import React from 'react';
import { BrowserRouter as Router, Switch, Route, Navigate } from 'react-router-dom';
import Login from './components/Login';
import Register from './components/Register';
import Products from './components/product/Poducts';
import Createproduct from './components/product/CreateProduct';
import Profile from './components/profile/Profile';
import Incommingorder from './components/order/IncomingOrder';
import ProductDetail from './components/product/ProductDetail';

function App() {
  return (
    <div>
      <Router>
        <Switch>
          {window.location.hostname === 'localhost' && <Route path="/" element={<Navigate to="/login" />} />}
          <Route path="/login" component={<Login />} />
          <Route path="/register" component={<Register />} />
          <Route path="/product" component={<Products />} />
          <Route path="/create" component={Createproduct} />
          <Route path="/profile" component={Profile} />
          <Route path="/order" component={Incommingorder} />
          <Route path="/product/:productId" component={ProductDetail} />
        </Switch>
      </Router>
    </div>
  );
};

export default App;
